import Layout from '../components/Layout';
function Dashboard() {
  return (
    <div className="p-10">
      <h1 className="text-3xl font-bold">Dashboard</h1>
      <p className="mt-2">Selamat datang di sistem akuntansi!</p>
    </div>
  );
}

export default Dashboard;
